        <Modal.Header closeButton>
          <Modal.Title>Settings</Modal.Title>
          <Modal.Body>
            Test
          </Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={handleCloseSetting}>
              Close
